    "# ipywidgets : UI라이브러리\n",
    "import ipywidgets as widget\n",
    "# 이미지나 소리 등을 출력하는 함수\n",
    "from IPython.display import display\n",
    "\n",
    "# Image() : 이미지를 출력하는 위젯\n",
    "# format=\".jepg\" : 출력할 이미지 타입\n",
    "# width,height : 출력할 이미지의 크기\n",
    "img_widget = widget.Image(format=\".jepg\",width=300,height=300)\n",
    "display(img_widget)\n",
    "\n",
    "# OpenCV에 입력된 이미지는 Numpy array라서 jpeg로 변환해주어야 한다\n",
    "_,en_img = cv2.imencode(\".jpeg\",img)\n",
    "\n",
    "img_widget.value = en_img.to"
